import './TransactionForm.css'
const TransactionForm = ()=>{

    return (
    <div>
       <form>
            
           <label>Text</label> 
           <input type="text" placeholder="Enter text..." />
           <label>Amount 
                <br/>
                {`(negative-expense , positive-income)`}
           </label>
       </form>
    </div>
    );
}

